import React from "react";
import { HeroSvg as HeroSvg } from "./herosvg.svg";

const Hero = () => {
    return(
        <div>
            <div className="hero-body">
                <h1>Jesse Lauesen</h1>
            </div>
            <div className="hero-footer container">
                <div className="svg-container">
                    <object type="image/svg+xml" data="pics/herosvg.svg" 
                    width="100%" height="100%" className="svg-content">
                    </object>
                </div>    
            </div>
        </div>
    )
}

export default Hero;
